import { useParams } from "react-router-dom";

const QuoteDetails = () => {
    const params = useParams();
    return (
        <section>
        <h1>Quote Details Page</h1>
        <p>{params.quoteId}</p>
        </section>
    )
}

export default QuoteDetails;
